import React, { useState } from 'react';
import { useCart } from '../context/CartContext';
import { FaShoppingCart, FaSearch, FaBars, FaTimes } from 'react-icons/fa';

const Header = () => {
  const { items } = useCart();
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [searchTerm, setSearchTerm] = useState('');

  const cartItemCount = items.reduce((total, item) => total + item.quantity, 0);

  return (
    <header className="bg-automotive-dark text-white shadow-lg sticky top-0 z-50">
      <div className="container mx-auto px-4">
        <div className="flex items-center justify-between h-16">
          {/* Logo */}
          <div className="flex items-center space-x-2">
            <div className="w-8 h-8 bg-automotive-orange rounded-lg flex items-center justify-center">
              <span className="text-white font-bold text-lg">🔧</span>
            </div>
            <h1 className="text-xl font-bold font-poppins">AutoPartHub</h1>
          </div>

          {/* Desktop Navigation */}
          <nav className="hidden md:flex items-center space-x-8">
            <a href="#" className="hover:text-automotive-orange transition-colors">Home</a>
            <a href="#" className="hover:text-automotive-orange transition-colors">Products</a>
            <a href="#" className="hover:text-automotive-orange transition-colors">About</a>
            <a href="#" className="hover:text-automotive-orange transition-colors">Contact</a>
          </nav>

          {/* Search Bar */}
          <div className="hidden md:flex items-center space-x-4 flex-1 max-w-md mx-8">
            <div className="relative w-full">
              <FaSearch className="absolute left-3 top-1/2 transform -translate-y-1/2 text-gray-400" />
              <input
                type="text"
                placeholder="Search parts, brands, or vehicles..."
                value={searchTerm}
                onChange={(e) => setSearchTerm(e.target.value)}
                className="w-full pl-10 pr-4 py-2 bg-white text-automotive-dark rounded-lg focus:outline-none focus:ring-2 focus:ring-automotive-orange"
              />
            </div>
          </div>

          {/* Cart Icon */}
          <div className="flex items-center space-x-4">
            <button className="relative p-2 hover:bg-automotive-orange rounded-lg transition-colors">
              <FaShoppingCart className="text-xl" />
              {cartItemCount > 0 && (
                <span className="absolute -top-1 -right-1 bg-automotive-orange text-white text-xs rounded-full w-5 h-5 flex items-center justify-center">
                  {cartItemCount}
                </span>
              )}
            </button>

            {/* Mobile Menu Button */}
            <button
              className="md:hidden p-2 hover:bg-automotive-orange rounded-lg transition-colors"
              onClick={() => setIsMenuOpen(!isMenuOpen)}
            >
              {isMenuOpen ? <FaTimes /> : <FaBars />}
            </button>
          </div>
        </div>

        {/* Mobile Menu */}
        {isMenuOpen && (
          <div className="md:hidden py-4 border-t border-gray-700">
            <nav className="flex flex-col space-y-4">
              <a href="#" className="hover:text-automotive-orange transition-colors">Home</a>
              <a href="#" className="hover:text-automotive-orange transition-colors">Products</a>
              <a href="#" className="hover:text-automotive-orange transition-colors">About</a>
              <a href="#" className="hover:text-automotive-orange transition-colors">Contact</a>
            </nav>
            
            {/* Mobile Search */}
            <div className="mt-4">
              <div className="relative">
                <FaSearch className="absolute left-3 top-1/2 transform -translate-y-1/2 text-gray-400" />
                <input
                  type="text"
                  placeholder="Search parts..."
                  value={searchTerm}
                  onChange={(e) => setSearchTerm(e.target.value)}
                  className="w-full pl-10 pr-4 py-2 bg-white text-automotive-dark rounded-lg focus:outline-none focus:ring-2 focus:ring-automotive-orange"
                />
              </div>
            </div>
          </div>
        )}
      </div>
    </header>
  );
};

export default Header;
